CREATE TABLE IF NOT EXISTS `furniture_inventory` (
  `furniture_id` int(10) unsigned NOT NULL,
  `owner` int(11) NOT NULL COMMENT 'Battle.net Account Id',
  `count` int(10) DEFAULT '0',
  `favorit` tinyint(1) unsigned DEFAULT '0',
  PRIMARY KEY (`furniture_id`,`owner`),
  CONSTRAINT `FK__furniture_catalog` FOREIGN KEY (`furniture_id`) REFERENCES `furniture_catalog` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;